import "bootstrap/dist/css/bootstrap.min.css"; 
function App() {
  return (
  <div className="container text-center">
    <div className="row">

      <div className="col">
      Bienvenido al sistema de recomendación
      </div>

      <div>
      <button className="col btn btn-primary">
        Una chimba e botón
      </button>
      </div>

      <div>
        <label for="customRange3" class="form-label">Calificaion</label>
        <input type="range" class="form-range" min="0" max="5" step="0.5" id="customRange3"/>
      </div>

    </div>
  </div>
  );
}

export default App;
